code.span:
terraform {
  backend "s3" {
    bucket         = "<your-tf-state-bucket>"
    key            = "envs/dev/terraform.tfstate"
    region         = "us-east-1"
    dynamodb_table = "<your-lock-table>"
    encrypt        = true
  }
}

variable "project" { type = string }
variable "region"  { type = string  default = "us-east-1" }
variable "tags"    { type = map(string) default = {} }
